import React from 'react';
import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import api from '../../services/api';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const createClickButton = async (event) => {
    event.preventDefault();
    try {
      const response = await api.post('/auth/login', {
        email,
        password,
      });
      sessionStorage.setItem('usuario', email);
      navigate('/produto');
    } catch (error) {
      if (error.response && error.response.status === 401) {
        alert('E-mail de usuario não cadastrado ou senha invalida');
      } else {
        alert('Ocorreu um erro inesperado');
      }
    }
  };

  return 
const linkStyle = {
  margin: '0 10px',
  color: '#2575fc',
  textDecoration: 'none'
};(
    <div className="container">
      <form onSubmit={createClickButton}>
        <div className="login--container">
          <h2>Login</h2>
  <nav style={{ marginBottom: '20px', textAlign: 'center' }}>
  <Link to="/" style={linkStyle}>Login</Link> | 
  <Link to="/produto" style={linkStyle}>Produtos</Link> | 
  <Link to="/usuario" style={linkStyle}>Usuários</Link> | 
  <Link to="/venda" style={linkStyle}>Vendas</Link>
</nav>
          <label>Email </label>
          <input
            type="email"
            value={email}
            placeholder="Digite o email"
            required
            onChange={(e) => setEmail(e.target.value)}
          />

          <br />

          <label>Password </label>
          <input
            type="password"
            value={password}
            placeholder="Digite o password"
            required
            onChange={(e) => setPassword(e.target.value)}
          />

          <br />

          <button className="login--buttton" type="submit">
            Entrar
          </button>

          <br />
          <br />

          <Link to="/usuario">Cadastre-se</Link>
        </div>
      </form>
    </div>
  );
};

export default Login;
